import React from "react";

import "../css/App.css";

function FilmOfWeek(){
    return(
        <div>
            <h1>Film of the Week</h1>
            <h3>National Treasure</h3>
            <p>
            I’m not sure how I’ve missed this one. 
            The perfect Sunday morning movie. 
            I was entertained from start to finish, however my only gripe would be that Nic Cage was quite reserved. 
            The film didn’t take itself too seriously in a good way so I was a little disappointed there was no signature 
            over the top Cage. I wanted to see Nic UnCaged, though I hear the sequel may be more for me then. 
            Not sure what the message of the film was, but what I got from it is that “the real National Treasure is the 
            man himself.” 
            Excited for part 2.
            <h3>7/10</h3>
            </p>
        </div>
    );
}

export default FilmOfWeek;
